ardware prototype\",\"Future Cities\",\"documentary\",\"silicon valley of hardware\",\"evolution\",\"technology\",\"Wired uk\",\"wired\",\"wired magazine\",\"wired video\",\"David Rowan\",\"pop culture\",\"science\",\"politics\",\"business\",\"conde nast\",\"health\",\"topics\",\"news\",\"gadgets\"],\"channelId\":\"UCWrXlzhIENTJrAuKVuPgdEA\",\"isOwnerViewing\":false,\"shortDescription\":\"Future Cities, a full-length documentary strand from WIRED Video, takes us inside the bustling Chinese city of Shenzhen. \\nSubscribe to WIRED http:\/\/po.st\/SubscribeWired\\n\\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the worlds leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of Shanzhai  or copycat manufacturing  has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called Silicon Valley of hardware\\\".\\n\\nABOUT FUTURE CITIES\\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\\n\\nHOLY LAND: STARTUP NATIONS (SERIES 2)\\nPremiering in February, the second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\\n\\nCONNECT WITH WIRED\\nWeb: http:\/\/po.st\/WiredVideo\\nTwitter: http:\/\/po.st\/TwitterWired\\nFacebook: http:\/\/po.st\/FacebookWired\\nGoogle+: http:\/\/po.st\/GoogleWired\\nInstagram: http:\/\/po.st\/InstagramWired\\nMagazine: http:\/\/po.st\/MagazineWired\\nNewsletter: http:\/\/po.st\/NewslettersWired\\n\\nABOUT WIRED\\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/SGJ5cZnoodY\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAcY3OGtIzlWNdvdIvzopicCbsU9w\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/SGJ5cZnoodY\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBInhlvOsPDjW9l0XudQCAXoA_rYQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/SGJ5cZnoodY\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAV3R-UJUbsowmgFiGXvdGiAakgVw\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/SGJ5cZnoodY\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDydG7kGAGyqMJE6UiUfRtSv2bKyg\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/SGJ5cZnoodY\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.7802615,\"allowRatings\":true,\"viewCount\":\"10491762\",\"author\":\"WIRED UK\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"0\",\"endTimeMs\":\"4050000\  series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\\n\\nCONNECT WITH WIRED\\nWeb: http:\/\/po.st\/WiredVideo\\nTwitter: http:\/\/po.st\/TwitterWired\\nFacebook: http:\/\/po.st\/FacebookWired\\nGoogle+: http:\/\/po.st\/GoogleWired\\nInstagram: http:\/\/po.st\/InstagramWired\\nMagazine: http:\/\/po.st\/MagazineWired\\nNewsletter: http:\/\/po.st\/NewslettersWired\\n\\nABOUT WIRED\\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.\"},\"lengthSeconds\":\"4071\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/WiredVideoUK\",\"externalChannelId\":\"UCWrXlzhIENTJrAuKVuPgdEA\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\ ubscribeWired","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the worlds leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of Shanzhai  or copycat manufacturing  has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called Silicon Valley of hardware\".\n\nABOUT FUTURE CITIES\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\n\nHOLY LAND: STARTUP NATIONS (SERIES 2)\nPremiering in February, the second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nCONNECT WITH WIRED\nWeb: "},{"text":"http://po.st/WiredVideo","navigationEndpoint":{"clickTrackingParams":"CJABEM2rARgBIhMIuJ3N4e2c6gIVhNUWCh2oSgSvSNbDos-Zrp6xSA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=SGJ5cZnoodY\u0026event=video_description\u0026redir_token=Ng46mVUZbOZU0PSX2XAntKawuUF8MTU5MzE3MDc3NEAxNTkzMDg0Mzc0\u0026q=http%3A%2F%2Fpo.st%2FWiredVideo","rootVe":83769}},"urlEndpoint":{ ntre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nCONNECT WITH WIRED\nWeb: http://po.st/WiredVideo\nTwitter: http://po.st/TwitterWired\nFacebook: http://po.st/FacebookWired\nGoogle+: http://po.st/GoogleWired\nInstagram: http://po.st/InstagramWired\nMagazine: http://po.st/MagazineWired\nNewsletter: http://po.st/NewslettersWired\n\nABOUT WIRED\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/SGJ5cZnoodY/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAcY3OGtIzlWNdvdIvzopicCbsU9w","width":168,"height":94},{"url":"https://i.ytimg.com/vi/SGJ5cZnoodY/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBInhlvOsPDjW9l0XudQCAXoA_rYQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/SGJ5cZnoodY/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAV3R-UJUbsowmgFiGXvdGiAakgVw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/SGJ5cZnoodY/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDydG7kGAGyqMJE6UiUfRtSv2bKyg","width":336,"height":188},{"url":"https://i.ytimg.com/vi/SGJ5cZnoodY/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.7802615 ry strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\n\nHOLY LAND: STARTUP NATIONS (SERIES 2)\nPremiering in February, the second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nCONNECT WITH WIRED\nWeb: http://po.st/WiredVideo\nTwitter: http://po.st/TwitterWired\nFacebook: http://po.st/FacebookWired\nGoogle+: http://po.st/GoogleWired\nInstagram: http://po.st/InstagramWired\nMagazine: http://po.st/MagazineWired\nNewsletter: http://po.st/NewslettersWired\n\nABOUT WIRED\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics."},"lengthSeconds":"4071","ownerProfileUrl":"http://www.youtube.com/user/WiredVideoUK","externalChannelId":"UCWrXlzhIENTJrAuKVuPgdEA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","
